import React from "react";
import {
  AppBar,
  Container,
  Toolbar,
  IconButton,
  Box,
  Typography,
  Button
} from "@mui/material";

const Navbar = () => {
  return (
    <>
      <AppBar>
        <Container>
          <Toolbar>
            <Box>
              <IconButton
                variant="outlined"
                onClick={() => {
                  console.log("hello!");
                }}
              >
                HOME
              </IconButton>
              <Typography>LALALA</Typography>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </>
  );
};

export default Navbar;
